    public function getEntitiesHelperInformation(array $entitiesFind): ?string
    {
        $informationAboutsEntities = '';
        foreach ($entitiesFind as $entity) {
            $data =  $this->getEntityHelperInformation($entity);
            if($data !== null){
                $informationAboutsEntities .= $data;
            }
        }

        return empty($informationAboutsEntities) ? null : $informationAboutsEntities;
    }

    public function getEntityHelperInformation(string $entityFind): ?string
    {
        $response = '###';
        $entities = json_decode($this->entitiesFull, true);
        foreach ($entities as $entity){
            if($entityFind == $entity['name']){
                $response .= 'Nazwa encji: "'. $entityFind . '" \n Lista pól: \n';

                $fields = '';
                foreach ($entity['fieldMapping'] as $field){
                    $fields .= $field['fieldName'] . '(' . $field['type'] . '), \n ';
                }

                return $response . $fields;
            }
        }

        return null;
    }
